import React, { Component } from 'react';
import RangeSlide from '../../components/RangeSlide';
class Filter extends Component {
    onClick(price) {
        console.log(price)
    }
    render() {
        return (
            <div className="list-group col-sm-3">
            <p style={{mixBlendMode: 'normal',opacity: 0.5,textTransform: 'uppercase'}}>  Filter By</p>
            <br/>
            <select className="form-control filter">
            <option>Collection</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
            </select>
            <select className="form-control filter">
            <option >Color</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
            </select>
            <select className="form-control filter">
            <option>Category</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
            </select>
            <RangeSlide />          
            <button onClick={this.onClick(this.props.price)}>Button</button>
            </div>

        );
    }
}

export default Filter;
